import styled from 'styled-components';
import { Box } from '../styles';

const STile = styled(Box)`
  a {
    text-decoration: none;
  }

  span {
    display: block;
    text-transform: uppercase;
  }

  img {
    display: block;
    width: 100%;
  }
`;

export default STile;
